import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';

// eslint-disable-next-line
const hello = <h1> Hello </h1>;
const Add = (props) => <h1> {props.a + props.b} </h1>

function App() {
  return(
      <div>
        <h1>  </h1>
      <Add a={3} b={5}/>
      </div>
  )}

ReactDOM.render()
export default App;
